import React, { useState, useEffect } from 'react';
import Layouts from '../../Layouts/Layouts';
import axios from 'axios';

function Projectdata() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/projects/allProjects');
        if (response) {
          setData(response.data);
        }
      } catch (error) {
        console.log("Error while fetching data");
      }
    };
    getData();
  }, []);

  return (
    <Layouts>
      <table>
        <thead>
          <tr>
            <th>SN</th>
            <th>ProjectID</th>
            <th>GuideID</th>
            <th>GuideName</th>
            <th>ReviewerID</th>
            <th>ReviewerName</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {data.guide && data.guide.map((project, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{project.ProjectID}</td>
              <td>{project.GuideID}</td>
              <td>{project.Name}</td>
              <td>{project.ReviewerID}</td>
              <td>{project.Name}</td>
              <td>
                {/* Add action button or link as needed */}
              </td>
            </tr>
          ))}

          {data.reveiwer && data.reveiwer.map((project, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{project.ProjectID}</td>
              <td>{project.GuideID}</td>
              <td>{project.Name}</td>
              <td>{project.ReviewerID}</td>
              <td>{project.Name}</td>
              <td>
                {/* Add action button or link as needed */}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </Layouts>
  );
}

export default Projectdata;
